Director: Jim Powers
Starring: Riley Reid , Nikki Hearts , Aj Applegate , Rose Red , Tyrell Van Wylde , Richie Calhoun , Giovanni Francisco , Tyler Nixon

Everybody Remembers Their First Summer Romance!
Get ready to be taken on an incredible journey as you go up and down the California coast with these hot young couples in love. Riley &amp; Richie when not at the beach they are in each others arms. Nikki &amp; Van surf waves together than explore each other sensually. Rose &amp; Tyler spend relaxing day at the pier and an afternoon in bed. AJ &amp; Giovanni cooking together-loving together!

